/* eslint-disable import/prefer-default-export */
export const QUERY_SIZE = 36;
export const MAX_PAGE = 8;

export const DATE_BOUNDARIES = {
  minYear: 2016,
  maxYear: 2020,
  minMonth: 1,
  maxMonth: 13,
  minDay: 1,
  maxDay: 29,
};

export const ENDPOINT_PREFIX = 'https://www.flickr.com/services/rest/?method=flickr.interestingness.getList&format=json&safe_search=3&api_key=b41ebc557f327c6c95cd8ab3ce1b25f6';
